DataManager.prototype.randomLevel = function(g, temple){
	var success = false;
	this.currentTemple = Math.min( temple, this.temples.length-1);
	var temple = this.temples[ this.currentTemple ];
	
	g.clearAll();
	g.tileSprite = sprites[temple.tiles];
	
	while( !success ) {
		this.key_counter = 0;
		this.branch_counter = 0;		
		
		this.room_matrix = {};
		this.junctions_matrix = {};
		this.properties_matrix = {};
		this.branch_matrix = {};
		
		this.room_matrix["-2_0"] = 0;
		this.room_matrix["-1_0"] = -1;
		
		var options = {
			"rules":this.rules.main
		}
		
		success = this.addRoom(options,temple.size,1, new Point(0,0));
		//success = this.addRoom(options,6,1, new Point(0,0));
		//break;
		if( this.junctionCount() > 0 ) {
			//Add a branch for a map
			this.addBranch({"rules":this.rules.item,"item":"map"}, Math.floor(2+Math.random()*3), this.getJunctions())
			
			//Add branches for items
			var current_brances = this.branch_counter;
			for(var i=0; i < Math.max(temple.tresures[1]-current_brances,temple.tresures[0]); i++ ){
				var b = this.addBranch({"rules":this.rules.item,"item":this.randomTresure()}, Math.floor(2+Math.random()*3), this.getJunctions())
				console.log( "Branch added? " + b );
			}
		} else {
			console.error("Seriously? No junctions? Try that again.");
			success = false;
		}
	}
	
	//Everything is okay, build the level
	var width = 256;
	var height = 240;
	
	//Establish the level size and build tile matrix
	g.tileDimension = new Line(0,0,0,0);
	for(var i in this.room_matrix){
		pos = new Point(
			~~i.match(/(-?\d+)/g)[0],
			~~i.match(/(-?\d+)/g)[1]
		);
		if( pos.x < g.tileDimension.start.x ) g.tileDimension.start.x = pos.x;
		if( pos.y < g.tileDimension.start.y ) g.tileDimension.start.y = pos.y;
		if( pos.x > g.tileDimension.end.x ) g.tileDimension.end.x = pos.x;
		if( pos.y > g.tileDimension.end.y ) g.tileDimension.end.y = pos.y;
	}
	var tile_width = width / 16;
	var tile_height = height / 16;
	g.tileDimension.start.x *= tile_width; g.tileDimension.end.x = (g.tileDimension.end.x+1) * tile_width;
	g.tileDimension.start.y *= tile_height; g.tileDimension.end.y = (g.tileDimension.end.y+1) * tile_height;
	g.tiles = [
		new Array( ~~g.tileDimension.area() ),
		new Array( ~~g.tileDimension.area() )
	];
	var mapDimension = g.tileDimension.scale(1.0/16,1.0/15)
	var mapTiles = new Array( Math.floor( mapDimension.area() ) );
	
	
	for(var i in this.room_matrix){
		var pos = new Point(
			~~i.match(/(-?\d+)/g)[0],
			~~i.match(/(-?\d+)/g)[1]
		);
		var map_index = Math.floor( pos.x - mapDimension.start.x + (pos.y - mapDimension.start.y) * mapDimension.width() );
		mapTiles[ map_index ] = 1;
		
		var room;
		if( this.room_matrix[i] == "j" ) {
			var tags = this.junctions_matrix[i];
			room = this.junctions[ this.getJunctionRoomIndex(tags) ];
		} else if ( this.room_matrix[i] >= 0 ) { 
			room = this.rooms[ this.room_matrix[i] ];
		} else { 
			room = null;
		}
		
		if( room ) {
			var cursor = new Point(pos.x * width, pos.y * height );
			this.createRoom(g,room,cursor,i);
			
			//If this room uses a specific map tile
			if( "map_tile" in room ) mapTiles[ map_index ] = room["map_tile"] - 0;
		}
	}
	g.collisions.push( new Line(-512,240,-512,0) );
	//g.collisions.push( new Line(cursor,0,cursor,240) );
	
	var pm = new PauseMenu();
	pm.map = mapTiles;
	pm.mapDimension = mapDimension;
	g.addObject(pm);
	audio.play("music");
	
	g.buildCollisions();
	
	//_player.lock = _player.lock = new Line(0,0,cursor,240);
	//_player.lock = _player.lock = new Line(0,0,Number.MAX_VALUE,-240);
}

DataManager.prototype.createRoom = function(g,room,cursor,id){
	var layers = ["back","front"];
	var minibosses = ["Knight","Oriax"];
	var ts = 16;
	
	//Render tiles
	for(var j=0; j < layers.length; j++ ) {
		if( layers[j] in room ) {
			for(var i=0; i < room[layers[j]].length; i++){
				var x = Math.floor( i % ( 16 * room.width ) );
				var y = Math.floor( i / ( 16 * room.width ) );
				var offset = Math.floor( 
					Math.floor( (x+g.tileDimension.start.x) + Math.floor( cursor.x / ts ) ) + 
					Math.floor( ((y+g.tileDimension.start.y) + Math.floor( cursor.y / ts ) ) * g.tileDimension.width() )
				);
				g.tiles[j][offset] = room[layers[j]][i];
			}
		}
	}
	
	//Add objects
	for(var j=0; j < room.objects.length; j++){
		var obj = room.objects[j];
		var objectName = obj[2];
		
		if( id in this.properties_matrix ){
			var props = this.properties_matrix[id];
		}
		
		if(objectName == "Boss") objectName = "Marquis";
		if(objectName == "Miniboss") objectName = minibosses[ Math.floor( Math.random() * minibosses.length ) ];
		
		//Debug mode
		if( window.debug && objectName == "Player" ) objectName = "Debuger";
		
		var new_obj;

		if( objectName == "Player" && window._player != undefined ) {
			_player.position.x = cursor.x + obj[0]; 
			_player.position.y = cursor.y + obj[1]; 
			g.addObject( _player );
		} else {
			var new_obj = new window[objectName](cursor.x + obj[0], cursor.y + obj[1]);
			g.addObject( new_obj );
		}
		
		
		if( id in this.properties_matrix ){
			var props = this.properties_matrix[id];
			if(objectName == "Item") new_obj.setName( "item" in props ? props["item"] : "error" );
			if(objectName == "Door") new_obj.name = "key_" + ("door" in props ? props["door"] : new_obj.name);
		}
	}
	
	for(var j=0; j < room.lines.length; j++){
		var line = room.lines[j];
		temp = new Line( 
			new Point( cursor.x + line[0], cursor.y + line[1] ),
			new Point( cursor.x + line[2], cursor.y + line[3] )
		);
		g.collisions.push( temp );
	}
}


DataManager.prototype.keysRemaining = function(){
	var temple = this.temples[ this.currentTemple ];
	return temple.maxkeys - dataManager.key_counter;
}
DataManager.prototype.getJunctionRoomIndex = function(tags){
	var out = [];
	var dir = ["n","e","s","w"];
	for( var i=0; i < this.junctions.length; i++ ) {
		var match = true;
		for(var j=0; j < dir.length; j++ ){
			var o = dir[j];
			if((this.junctions[i].type.indexOf(o) < 0) != (tags.indexOf(o) < 0))
				match = false;
		}
		if( match ) out.push(i);
	}
	return out[0];
}
DataManager.prototype.addBranch = function(options, level, junctions){
	var compass = ["n","e","s","w"];
	
	junctions.sort(function(){ return Math.random()-.5; });
	compass.sort(function(){ return Math.random()-.5; });
	this.branch_counter++;
	
	for( var i=0; i < junctions.length; i++ ) {
		var _i = junctions[i];
		var tags = this.junctions_matrix[_i];
		pos = new Point( ~~_i.match(/(-?\d+)/g)[0], ~~_i.match(/(-?\d+)/g)[1] );
		
		//Shuffle directions
		
		for(var j=0; j < compass.length; j++ ){
			//Check the four cardinal directions to see if one is free
			var d = compass[j];
			if( tags.indexOf( d ) < 0 ) {
				//This direction is free.
				if( d == "n" ) {
					if( this.addRoom(options, level, 0, new Point(pos.x, pos.y-1), new Point(0,1)) ){
						tags.push(d);
						return true;
					}
				} else if ( d = "e" ) {
					if( this.addRoom(options, level, 1, new Point(pos.x+1, pos.y)) ){
						tags.push(d);
						return true;
					}
				} else if ( d = "s" ) {
					if( this.addRoom(options, level, 0, new Point(pos.x, pos.y+1), new Point(0,-1)) ){
						tags.push(d);
						return true;
					}
				} else if ( d = "w" ) {
					if( this.addRoom(options, level, -1, new Point(pos.x-1, pos.y)) ){
						tags.push(d);
						return true;
					}
				}				
			}
		}
	}
	this.branch_counter--;
	return false;
}
DataManager.prototype.addRoom = function(options, level, direction, cursor, connector){
		
	//List of rooms to try
	var r = [];
	
	if( connector instanceof Point ) {
		//connecting room
		var _d = Math.random();
		r.push( ["j", 1, 0] );
		r.push( ["j", -1, 0] );
	} else {
		//Use assigned rule set
		r = options.rules.apply(this,[level,direction,options]);
	}
	
	//Scramble order
	r.sort(function(a,b){ return Math.random()-.5; } )
	
	var success = false;
	
	for(var j = 0; j < r.length; j++ ) {
		//Go through rooms until one fits
		var room_data = r[j];
		var room;
		var isJunction = room_data[0] == "j";
		if( isJunction ) room = {"width":1}
		else room = this.rooms[ room_data[0] ];
		var new_direction = room_data[1];
		var temp_properties = room_data.length > 3 ? room_data[3] : {};
	
		if( this.isFree( room, new_direction, cursor ) ) {
			success = true;
		
			//fill in tiles
			for( i=0; i < room.width; i++){
				var pos = new Point( cursor.x + i * new_direction, cursor.y );
				var id = ~~pos.x +"_"+ ~~pos.y;
				this.room_matrix[ id ] = -1;
				
				var top_left = new_direction > 0 ? (i==0) : (i==room.width-1);
				
				if( top_left ) {
					this.room_matrix[ id ] = room_data[0];
					this.properties_matrix[ id ] = temp_properties;
					
					if( isJunction ) {
						this.junctions_matrix[ id ] = [];

						if( connector instanceof Point ) {
							if( new_direction > 0 ) this.junctions_matrix[ id ].push( "e" ); else this.junctions_matrix[ id ].push( "w" ); 
							if( connector.y > 0 ) this.junctions_matrix[ id ].push( "s" ); else this.junctions_matrix[ id ].push( "n" ); 
						} else {
							if( room_data[2] != 0 ){
								if( new_direction > 0 ) this.junctions_matrix[ id ].push( "w" ); else this.junctions_matrix[ id ].push( "e" );
								if( room_data[2] > 0 ) this.junctions_matrix[ id ].push( "s" ); else this.junctions_matrix[ id ].push( "n" );
							} else {
								this.junctions_matrix[ id ].push( "w" );
								this.junctions_matrix[ id ].push( "e" );
							}
						}
					}
				}
			}
			
			//More rooms to go?
			if( level > 0 ){
				
				if( "door" in temp_properties ){
					var id = ~~cursor.x +"_"+ ~~cursor.y;
					var key_name = "key_" + this.key_counter;
					this.key_counter++;
					//success = success && this.createBranchNotice(id,{"rules":this.rules.item,item:key_name});
					success = this.addBranch({"rules":this.rules.item,item:key_name}, 8, this.getJunctions());
					
				} 
				if( isJunction ) {
					//This is a junction, go up
					if( connector instanceof Point ){
						//Connect to previous room
						var next_cursor = new Point(cursor.x + room.width * new_direction, cursor.y);
						success = success && this.addRoom(options, level-1, new_direction, next_cursor);
					} else {
						//New junction
						if( room_data[2] != 0 ) {
							var next_cursor = new Point(cursor.x, cursor.y + room_data[2]);
							success = success && this.addRoom(options, level-1, new_direction, next_cursor, new Point(0,-room_data[2]));
						} else {
							//This may be a junction, but it doesn't go upstairs
							var next_cursor = new Point(cursor.x + room.width * new_direction, cursor.y);
							success = success && this.addRoom(options, level-1, new_direction, next_cursor);
						}
					}
				} else {
					var next_cursor = new Point(cursor.x + room.width * new_direction, cursor.y);
					success = success && this.addRoom(options, level-1, new_direction, next_cursor);
				}
				
				if( !success ) {
					//clear this room
					for( i=0; i < room.width; i++){
						var pos = new Point( cursor.x + i * new_direction, cursor.y );
						var id = ~~pos.x +"_"+ ~~pos.y;
						delete this.room_matrix[ id ];
						delete this.junctions_matrix[ id ];
						delete this.properties_matrix[ id ];
						delete this.branch_matrix[ id ];
						if( "door" in temp_properties ) this.key_counter--;
					}
				} else {
					return true;
				}
			} else { 
				return true;
			}
		}
		
		//All pieces fit, end
		if( success ) return true; 
	}
	
	return false;
}

DataManager.prototype.isFree = function(room, direction, cursor){
	for( i=0; i < room.width; i++){
		var pos = new Point( cursor.x + i * direction, cursor.y );
		var id = ~~pos.x +"_"+ ~~pos.y;
		if( id in this.room_matrix ) return false
	}
	return true;
}

DataManager.prototype.randomRoom = function(){
	var total = 0.0;
	for(var i=0; i<this.rooms.length; i++) total += this.rooms[i].rarity;
	var roll = Math.random() * total;
	for(var i=0; i<this.rooms.length; i++) {
		if( roll < this.rooms[i].rarity ) return i;
		roll -= this.rooms[i].rarity;
	}
	return 1;
}
DataManager.prototype.roomFromTags = function(tags){
	var rooms = this.roomsFromTags(tags)
	if( rooms.length > 0 )
		return rooms[0];
	return this.randomRoom();
}
DataManager.prototype.roomsFromTags = function(tags){
	var out = [];
	for(var j=0; j < this.rooms.length; j++ ){
		if( "tags" in this.rooms[j] ){
			for(var i=0; i < tags.length; i++ ){
				if( tags[i] == this.rooms[j].tags || this.rooms[j].tags.indexOf(tags[i]) >= 0 ){
					out.push(j);
					break;
				}
			}
		}
	}
	return out;
}
DataManager.prototype.randomTresure = function(){
	var total = 0.0;
	for(var i=0; i<this.tresures.length; i++) total += this.tresures[i].rarity;
	var roll = Math.random() * total;
	for(var i=0; i<this.tresures.length; i++) {
		if( roll < this.tresures[i].rarity ) return this.tresures[i].name;
		roll -= this.tresures[i].rarity;
	}
	return this.tresures[0].name;
}
DataManager.prototype.createBranchNotice = function(id,ops){
	var out = { "junctions":[], options:ops };
	var junctions_exist = false;
	for( var i in this.junctions_matrix ){
		out.junctions.push(i)
		junctions_exist = true;
	}
	this.branch_matrix[id] = out;
	return junctions_exist;
}
DataManager.prototype.getJunctions = function(){
	var out = [];
	for( var i in this.junctions_matrix )out.push(i);
	return out;
}
DataManager.prototype.junctionCount = function(){
	return this.getJunctions().length;
}

